void elementFind()
{
	int beginEle = 1;
	for(int i = 0; i < calNum; i++) 
	{
		if (status[i] != beginEle)
		{
			eleNum += 1;
			eleBegin[eleNum] = i ;
			eleEnd[eleNum - 1] = i - 1;
			eleArray[eleNum - 1] = beginEle; 
			beginEle = status[i];
		}
	}
	eleArray[eleNum] = 1;
	eleEnd[eleNum] = calNum; 
}

