// 
void eleMatch()
{
	int lenthInt = 0;
	for(int i = 0; i < eleLen; i++)
	{
		if(((rightSpeedInt + leftSpeedInt) / 2 / 10) >= lenthInt)
		{
			lenthInt += eleLenth[i];
			i++;
		}
		else
		{
			nowEleNum = i - 2; nowEleNum = nowEleNum > 0 ? nowEleNum : 0; break;
		}
	}
}

//
void PosCalculate()
{
	//
	for(int i = nowPosL - 3; i < calNum; i++)
	{
		if(posL[i] > (leftSpeedInt / 10))
		{
			nowPosL = i;
			nowPosL =  nowPosL < 3 ? 3 : nowPosL; 
			break;
		}
	}
	
	//
	for(int j = nowPosR - 3; j < calNum; j++)
	{
		if(posR[j] > (rightSpeedInt / 10))
		{
			nowPosR = j;
			nowPosR =  nowPosR < 3 ? 3 : nowPosR; 
			break;
		}
	}
	
	//
	nowPos = (nowPosL + nowPosR) / 2;
}

